import React from 'react';
import { FatherName, LastName } from './App';


const ComC = () => {
    return (<>
        <FatherName.Consumer>
            {(fname) => {
                return (
                    <LastName.Consumer>
                        {(lname) => {
                            return (
                                <h1>
                                    My name is kirti {fname} {lname}
                                </h1>
                            );
                        }}
                    </LastName.Consumer>
                );
            }}
        </FatherName.Consumer>
    </>);
};

export default ComC;
